response.activities:
Руководитель компании Волга - Строй. Натяжные потолки в Самаре. Полный комплекс работ: 
- замер; 
- производство;
- монтаж натяжных потолков. 
Замер и консультация клиента бесплатно, даже в случае отказа клиента от покупки. 149р/м2 за полотно без запаха, монтаж за 3 часа, работаем с пылесосом без грязи и пыли.
